(async () => {
    const { expect } = await import('chai');
  
    describe("ProductContract", function () {
      it("should create a product", async function () {
        const ProductContract = await ethers.getContractFactory("ProductContract");
        const productContract = await ProductContract.deploy();
        await productContract.deployed();
  
        await productContract.createProduct(
          "Blueberry Batch 1",
          "Fresh blueberries from farm A",
          "Farm A",
          "2024-06-01",
          "Organic farming practices"
        );
  
        const product = await productContract.getProduct(1);
        expect(product.name).to.equal("Blueberry Batch 1");
      });
    });
  
    describe("TransactionContract", function () {
      it("should purchase a product", async function () {
        const ProductContract = await ethers.getContractFactory("ProductContract");
        const productContract = await ProductContract.deploy();
        await productContract.deployed();
  
        await productContract.createProduct(
          "Blueberry Batch 1",
          "Fresh blueberries from farm A",
          "Farm A",
          "2024-06-01",
          "Organic farming practices"
        );
  
        const TransactionContract = await ethers.getContractFactory("TransactionContract");
        const transactionContract = await TransactionContract.deploy(productContract.address);
        await transactionContract.deployed();
  
        await transactionContract.purchaseProduct(1, { value: ethers.utils.parseEther("1") });
  
        const transaction = await transactionContract.getTransaction(1);
        expect(transaction.productId).to.equal(1);
      });
    });
  })();

